女子力満開でゴルフを楽しもう☆

ステンレススチールヘッド. ディープキャビティバック低重心設計

フェイス後方、キャビティ内部にも重心が中央に集まるようトライアングル設計を採用

これによりスウィングのバランスとショットの力が中央に集中し容易にボールが上がり、確実な飛距離と方向性を生み出します

100ヤード以内で威力を発揮するアプローチウェッジも装備（50°）ソールバックにワールドイーグルマーク

キャビテイ内部はグレーグランドにブルーカラーを分散したメダリオンバッジつき重厚感溢れるデザイン

